import React from 'react';
import PropTypes from 'prop-types';
import Location from './Location';

const LocationList = (props) => {

    const locationComponents = props.locations.map((location, index)=>{
        return (
            <li key={index}>
                <Location>
                    id={location.id}
                    name={location.name}
                    lat={location.lat}
                    lon={location.lon}
                </Location>
            </li>
        )
    })

    return (
        <section>
            <h2>Location List</h2>
            <ul>
                {locationComponents}
            </ul>
        </section>
    );
};



export default LocationList
